import React from "react";
import { Routes, Route, Link } from "react-router-dom";


import './ProductCard.css'

const ProductCard = ({ sool }) => {  
    const url = `/detail/${sool.id}`
    const textDecoNone = {
      textDecoration: 'none'
    };

    return(
      <>  
        <Link to={url} style={textDecoNone}>
          <li className="product-container" id={sool.id}>
            <div className="product__card">
              <div className="product__picture">
                <img src={sool.img} />
              </div>
              <div className="product__content">
                <span className="product__name">{sool.name}</span>
                <span className="product__price">1000원</span>
              </div>
            </div>
          </li>
        </Link>
      </>
    )
}

export default ProductCard;
